import React, { Component } from "react";

import '../../App.css';
import { Player } from 'video-react';

class Home extends Component {

    constructor(props){
        super(props);       
      
    }
 
  


    render() {
             
        return (
       
            <iframe width="500" height="250" src="https://295-videos.s3.us-east-2.amazonaws.com/SampleVideo_360x240_5mb.mp4"></iframe>
        
            

        );
    }
}



export default Home;
